<html>

<head>
    <script src="https://cdn.tailwindcss.com"></script>
    <link href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/5.15.3/css/all.min.css" rel="stylesheet" />
    <style>
        *{
            margin:0;
            padding:0;
            break-inside: avoid;
        }
    </style>
</head>

<body class="bg-gray-100 p-8" id="boxes">
    <div class="max-w-4xl mx-auto bg-white p-8 shadow-lg">
        <div class="flex justify-between items-center mb-2">
            <div>
                <img alt="Academy UK logo" class="h-20 w-20"
                    src="data:image/png;base64,">
            </div>
            <div class="text-center">
                <h1 class="text-xl font-bold">Academy of E learning, Britain</h1>
                <p class="text-sm">الاكاديمية البريطانية للتعليم الالكتروني</p>
            </div>
            <div>
                <img alt="ASC logo" class="h-16 w-16"
                    src="data:image/jpeg;base64," />
            </div>
        </div>
        <div class="max-w-4xl mx-auto">
            <h1 class="text-center text-2xl font-bold mb-2">
                Admissions Acceptance
            </h1>
            <p class="mb-2">
                <span class="font-bold">
                    ({{ $student->first_name . ' ' . $student->father_name . ' ' . $student->last_name }} ,
                    {{ $student->dob }})</span>
                ,
                <br />
                Address: {{ $student->permanent_address }}, {{ $student->permanent_village }},
                {{ $student->permanent_district }}
                <br />
                Email: {{ $student->email }}
                <br />
                WhatsApp:
            </p>
            <p class="text-right">{{ $today_date }}</p>

            <p class="mb-2">
                Dear
                <span class="font-bold"> ({{ $student->first_name . ' ' . $student->last_name }}) </span>
                ,
            </p>
            <p class="mb-2">
                Congratulations! I am very pleased to inform you of your acceptance to
                the Academy of E-Learning Britain.
            </p>
            <p class="mb-2">
                Your submitted Admissions Portfolio qualified you for admissions to the
                following academic program for the term specified below:
            </p>
            <p class="mb-2 bg-yellow-200 p-4">
                <span class="font-bold"> ({{ $student->program->title }}) </span>
                <br />
                <span class="font-bold">
                    ({{ $student->program->faculty->title }}, International American University)
                </span>
                <br />
                <span class="font-bold"> ({{ $admission_session->title }}, {{$admission_session->semester->title }}) </span>
                <br />
                Program Start Date:
                <span class="font-bold"> ({{ $session_start_date }}) </span>
                <br />
                Expected End Date:
                <span class="font-bold"> ({{$program_expected_end_date}}) </span>
            </p>
            <p class="mb-2">
                To complete your enrollment and start your study for
                <span class="font-bold"> ({{ $admission_session->title }}) </span>
                , you must take the following steps to meet the enrollment requirements.
            </p>
            <ol class="list-decimal list-inside mb-2">
                <li>Read carefully your study plan.</li>
                <li>
                    Read carefully and sign the Enrollment Agreement and submit it to
                    <span class="font-bold"> ({{ $today_date }}) </span>
                    by
                    <span class="font-bold"> ({{ now()->addWeek()->toDateString() }}) </span>
                    .
                </li>
                <li>
                    Get in contact with your academic advisor to get access to your
                    account on our academic platforms, get enrolled in your courses, and
                    follow up on your academic progress.
                </li>
            </ol>
            <p class="mb-2">
                We are delighted to welcome you to our family at the Academy of
                E-Learning Britain.
            </p>
            <p class="mb-2">
                Should you have any further questions, please contact us on
                <span class="font-bold"> (+201008653722) </span>
                .
            </p>
            <p class="mb-2">Best of luck,</p>
            <p class="mb-2">
                {{-- <span class="font-bold"> (------------- , -----------) </span> --}}
                <br />
                AEB academic affairs
            </p>
            <p class="mb-2"><img width="100" height="100" src="data:image/png;base64," alt=""></p>
        </div>
    </div>
    {{-- JS --}}
    <script src="https://code.jquery.com/jquery-3.7.1.min.js"
        integrity="sha256-/JqT3SQfawRcv/BIHPThkBvs0OEvtFFmqPF/lYI/Cxo=" crossorigin="anonymous"></script>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/html2pdf.js/0.10.1/html2pdf.bundle.min.js"
        integrity="sha512-GsLlZN/3F2ErC5ifS5QtgpiJtWd43JWSuIgh7mbzZ8zBps+dvLusV+eNQATqgA/HdeKFVgA5v3S/cIrLF7QnIg=="
        crossorigin="anonymous" referrerpolicy="no-referrer"></script>

    <script>
        function closeScript() {
            setTimeout(function() {
                window.open(window.location, '_self').close();
            }, 1000);
        }

        $(window).on('load', function() {
            var element = document.getElementById('boxes');
            var opt = {
                filename: 'Acceptance-Letter.pdf',
                image: {
                    type: 'jpeg', // Changed to jpeg
                    quality: 0.75 // Reduced quality
                },
                html2canvas: {
                    scale: 2, // Reduced scale
                    dpi: 96, // Reduced dpi
                    letterRendering: true
                },
                jsPDF: {
                    unit: 'in',
                    format: 'A4'
                }
            };
            html2pdf().set(opt).from(element).save().then(closeScript);
        });
    </script>
</body>

</html>
